  false,\n\t\"url\": null,\n\t\"notes\": \"The Cache Creek watershed is located in
  the California Coastal range approximately 100 miles north of San Francisco in Lake,
  Colusa and Yolo Counties. Wildlife resources in the Cache Creek drainage include
  the second largest wintering population of bald eagles in California, peregrine
  falcons, tule elk, river otters, foothill yellow legged frog and other wildlife.
  The Cache Creek watershed has been identified as a dominant Coast Range source of
  mercury to the Sacramento River and the Delta. This report represents an independent
  effort by the Fish and Wildlife Service to quantify mercury bioaccumulation in the
  Cache Creek watershed.  Our evaluation of mercury concentrations in biota focused
  upon the downstream hydrological region of Cache Creek, the upstream portion of
  the North for of Cache Creek and Bear Creek above and below inputs from Sulphur
  Creek, but did not include sampling in Clear Lake as this area has been well characterized
  for mercury bioaccumulation by others (Suchanek et al, 1993 and 1995).\",\n\t\"license_title\":
